import React from 'react';
import {
    View,
    Text,
    StyleSheet,
    Image,
    ScrollView
} from 'react-native';
import {Card, ListItem, Button, Icon} from 'react-native-elements';
import Header from './appDrawerHeader';


export default function Content2({state, setState}) {

    return (
        <ScrollView>
            <Header  state={state}  setState={setState} />
            <View style={
                {
                    display: "flex",
                    justifyContent: "center",
                    alignItems: "center"
                }
            }>

                <Text style={
                    {
                        fontSize: 30,
                        textAlign: "center",
                        padding: 10
                    }
                }>
                    What would you like to buy today?
                </Text>
            </View>
            <View >
                <View>
                    <Card>
                        <Card.Title>Vehicles</Card.Title>
                        <Card.Divider/>
                        <Image source={
                            require('./img/vehivles.jpg')
                        }
                            style={
                                styles.bannner
                            }/>
                        <Text style={
                            {marginBottom: 10}
                        }>
                            Get all your business's Vehicle needs from one place.
                        </Text>
                        <Button icon={
                                <Icon
                            name='code'
                            color='#ffffff'/>
                            }
                            buttonStyle={
                                {
                                    borderRadius: 0,
                                    marginLeft: 0,
                                    marginRight: 0,
                                    marginBottom: 0
                                }
                            }
                            
                            title='VIEW MORE'/>
                    </Card>
                </View>

                <View>
                    <Card>
                        <Card.Title>Property Rentals</Card.Title>
                        <Card.Divider/>
                        <Image source={
                                require('./img/content2.png')
                            }
                            style={
                                styles.bannner
                            }/>
                        <Text style={
                            {marginBottom: 10}
                        }>
                            Get all your Office space needs from one place.
                        </Text>
                        <Button icon={
                                <Icon
                            name='code'
                            color='#ffffff'/>
                            }
                            buttonStyle={
                                {
                                    borderRadius: 0,
                                    marginLeft: 0,
                                    marginRight: 0,
                                    marginBottom: 0
                                }
                            }
                            title='VIEW MORE'/>
                    </Card>
                </View>
                <View>
                    <Card>
                        <Card.Title>Apparel</Card.Title>
                        <Card.Divider/>
                        <Image source={
                                require('./img/content2.png')
                            }
                            style={
                                styles.bannner
                            }/>
                        <Text style={
                            {marginBottom: 10}
                        }>
                            Get all your business's uniform and apparel needs.
                        </Text>
                        <Button icon={
                                <Icon
                            name='code'
                            color='#ffffff'/>
                            }
                            buttonStyle={
                                {
                                    borderRadius: 0,
                                    marginLeft: 0,
                                    marginRight: 0,
                                    marginBottom: 0
                                }
                            }
                            title='VIEW MORE'/>
                    </Card>
                </View>
                <View>
                    <Card>
                        <Card.Title>Electronics</Card.Title>
                        <Card.Divider/>
                        <Image source={
                                require('./img/content2.png')
                            }
                            style={
                                styles.bannner
                            }/>
                        <Text style={
                            {marginBottom: 10}
                        }>
                            Get all your business's IT and Electronic needs.
                        </Text>
                        <Button icon={
                                <Icon
                            name='code'
                            color='#ffffff'/>
                            }
                            buttonStyle={
                                {
                                    borderRadius: 0,
                                    marginLeft: 0,
                                    marginRight: 0,
                                    marginBottom: 0
                                }
                            }
                            title='VIEW MORE'/>
                    </Card>
                </View>
            </View>
        </ScrollView>
    )

}


const styles = StyleSheet.create({
    bannner: {
        width: '100%',
        height: 200,
        alignItems: 'center',
        justifyContent: 'center'
    },
    // colView: {
    //     display: 'flex',
    //     flexDirection: 'row',
